The last Stones album in which cover material accounted for 50 percent of the content was thrown together from a variety of singles, British LP tracks, outtakes, and a cut from an early 1964 U.K. EP. Haphazard assembly aside, much of it's great, including the huge hit &quot;Get Off of My Cloud&quot; and the controversial, string-laden acoustic ballad &quot;As Tears Go By&quot; (a Top Ten item in America). 

Raiding the R&amp;B closet for the last time, they also offered a breathless run-through of Larry Williams' &quot;She Said Yeah,&quot; a sultry Chuck Berry cover (&quot;Talkin' About You&quot;), and exciting live versions of &quot;Route 66&quot; and Hank Snow's &quot;I'm Moving On.&quot;

More importantly, Jagger-Richards' songwriting partnership had now developed to the extent that several non-A-side tracks were reasonably strong in their own right, such as &quot;I'm Free&quot; and &quot;The Singer Not the Song.&quot; And the version of &quot;You Better Move On&quot; (which had been featured on a British EP at the beginning of 1964) was one of their best and most tender soul covers.


